   249→async function selectNextTask(): Promise<TaskSpec> {
   250→  const randomSeed = crypto.randomBytes(8).toString("hex");
   251→  const state = getEcosystemState();
   252→  const researcher = getAvailableResearcher();
   253→
   254→  // Pick unused color
