   256→  const infoboxColor = secureRandomElement(availableColors) || secureRandomElement(INFOBOX_COLORS) || "#b0c4de";
   257→
   258→  // Pick article type (rotate through them)
   259→  const articleType = secureRandomElement(ARTICLE_TYPES) || "phenomenon";
   260→
   261→  // Pick underrepresented category
   262→  let category = "linguistics";
   263→  const minCount = Math.min(...Object.values(state.categoryBalance).filter(v => v > 0), 999);
   264→  const underrepresented = Object.entries(state.categoryBalance)
   265→    .filter(([_, count]) => count <= minCount + 1)
   266→    .map(([cat, _]) => cat);
   267→  if (underrepresented.length > 0) {
   268→    category = secureRandomElement(underrepresented) || category;
   269→  }
   270→
   271→  const ecosystemStats = {
   272→    totalArticles: state.articleCount,
   273→    brokenLinks: state.brokenLinks.length,
   274→    orphans: state.orphans.length,
   275→    placeholders: state.placeholders.length,
   276→  };
   277→
   278→  // Priority 1: Broken links (CRITICAL)
